mapper.select:

select 

from FCMSGOUT
where FCMSGOUT_TXDATE = #{fcmsgoutTxdate,jdbcType=CHAR}
  and FCMSGOUT_BRNO = #{fcmsgoutBrno,jdbcType=CHAR}
  and FCMSGOUT_FEPNO = #{fcmsgoutFepno,jdbcType=CHAR}

mapper.delete:

delete from FCMSGOUT
where FCMSGOUT_TXDATE = #{fcmsgoutTxdate,jdbcType=CHAR}
  and FCMSGOUT_BRNO = #{fcmsgoutBrno,jdbcType=CHAR}
  and FCMSGOUT_FEPNO = #{fcmsgoutFepno,jdbcType=CHAR}
